INSERT INTO `meme_post` (`id`, `title`, `description`, `usr_id`, `date_added`, `active`, `lang`, `thumb_url`, `img_url`, `comment_count`) VALUES
(9, 'Me Gusta', '<b>Acerca de...</b>\r <br/> Me Gusta es una cara para rage comics que se usa para responder a una situación incomoda o desagradable. Originalmente era usado solo en contextos pervertidos, pero su uso se ha ampliado para cubrir otros gustos perturbadores.\r <br/> <b>Origen</b>\r <br/> En un post de Reddit, en Marzo 8 de 2011, el usuario Insert, dice haber dibujado la cara original, y luego la posteo a 4chan.\r <br/> <b>Difusión</b>\r <br/> El primer comic en Reddit fue subido en Marzo 18, 2010, por me_gusta.\r <br/> En un comentario el dice haber encontrado la cara en 4chan antes de subirla a Reddit.\r <br/> \r <br/> Es uno de los memes más usados y se puede encontrar en casi cualquier lugar.', 26, '2012-01-08 22:53:15', 1, 'ES', '0ef39ea9b11fbc0dab28eb35799ed7cdthumbnail.jpg', 'fbd81d779087dee734f42aadcfa1fdcc.jpg', 0),
(8, 'Y U NO? XQ NO?', '<b>Acerca de..</b>\r\n <br/> Y U NO es una macro serie de imagenes donde se utiliza mala ortografia como en los mensajes de texto o chats, para llamar la atencion de alguien, respecto a un tema especifico.\r\n <br/> <b>Origen</b>\r\n <br/> La expresion facial del personaje, llena de frustracion e ira, puede ser encontrada en Gantz, capitulo 55, Rey Desnudo(&#35064;&#12398;&#29579;&#27096;).\r\n<br/>\r\n<img src=''http://memegusta.com.co/m/uploads/meme/gantz.jpg''/>', 26, '2012-01-08 18:45:17', 1, 'ES', 'fc6e53a260823d4fbfe39649adf686d5thumbnail.jpg', 'ca982f52fa95525f27b207ffec9ec0bf.jpg', 0),
(7, 'Aww Yea', 'Aww Yea es usado para expresar una explosión de alegría y gozo. El origen de este meme se encuentra en la película Spiderman 2 y es nada menos que el jefe de Peter Parker, J. Jonah Jameson.\r\n <br/> \r\n <br/> <b>Año:</b> 2010\r\n <br/> <b>Origen:</b> Reddit<br/>\r\n<b>Origen en video:</b><br/>\r\n<iframe width="480" height="360" src="http://www.youtube.com/embed/OpAx0qyPRMw" frameborder="0" allowfullscreen></iframe>', 26, '2012-01-08 18:12:40', 1, 'ES', '0033d9c2405bcbae273f110ea6441d6fthumbnail.jpg', 'fed9257ab2a28275069ea1562dc05eac.jpg', 0),
(6, 'Are you fucking kidding me?', '<p>A "Are you fucking kidding me?" le asombra la estupidez humana de muchas personas. Traducido al castellano vendría a ser algo como "¿Tengo cara de tonto?" o "¿Me estás tomando el pelo?".</p>\r\n\r\n<b>Año:</b> 2010<br/>\r\n<b>Origen:</b> 4chan<br/>', 26, '2012-01-08 17:52:30', 1, 'ES', '7fdcdf7f4bc43824a6bc85dde1e3bb77thumbnail.jpg', 'b18f3ba398d2d0309f4f64ec53987ef0.jpg', 0),
(10, 'Forever Alone, Por siempre solo', '<b>Acerca de...</b>\r <br/> Forever alone es un personaje de Rage Comic que se usa para expresar soledad y decepción con la vida. Los creadores de estos rages a veces cambian la palabra Alone por otras para agregarle otro sentido, como Forever a Stone.\r <br/> \r <br/> <b>Origen</b>\r <br/> Es poco claro como comenzo, ya que hay muchas mutaciones, se cree que el primero fue en Abril del 2010, pero no hay otra información que permita corroborarlo.\r <br/> \r <br/> <b>Esparcimiento</b>\r <br/> En Mayo 28 del 2010 una imagen fue posteada en Funny Junk, que clamaba ser la primera instancia de la peculiar cara en ese sitio, ahora hay más de 23000 resultados con Forever Alone en ese site y más de 50.000 en Tumblr.', 26, '2012-01-08 22:21:05', 1, 'ES', '5707b2c7b0fda99edd018f0f5f74543dthumbnail.jpg', 'aafb427bfe61cdeb6cdc30596e943af7.jpg', 0),
(12, 'Fuck That', '<b>Acerca de...</b>\r\nFuck That Guy o Dumb Bitch se refiere a un personaje de Rage Comic, el contorno de la cara del basketbolista Yao Ming con una gran sonrisa.\r\nLa imágen se usa para representar una actitud de no me importa, o me rindo, o estas diciendo una idiotez ante la respuesta de alguien.\r\n<b>Origen</b>\r\nEl personaje esta basado en una fotografia captaruda en una entrevista de Mayo de 2009, en el siguiente video 1:29 aparece haciendo esta cara.\r\n<img src=''./uploads/meme/yaoming.jpg''/>\r\n<br/>\r\n<iframe width="480" height="360" src="http://www.youtube.com/embed/S-9xVUmmg1s" frameborder="0" allowfullscreen></iframe>\r\n<br/>\r\nOtra variación usada es como la de asco, Fuck no   \r\n<img src=''./uploads/meme/yaoming2.jpg''/>', 26, '2012-01-08 22:53:34', 1, 'ES', '38440ddf493735ff4ba955069a4ca600thumbnail.jpg', 'b6e1706890b1d44d08b78a259f5881b7.jpg', 0),
(1000001, 'GOOD GUY GREG  "buen chico greg"', '<b>GOOD GUY GREG \r <br/> \r <br/> origen: nació en la pagina 4chan.com en la cual fue posteado en un marco bajo el titulo de Good Guy Greg aun se desconoce de quien es la foto o quien fue el que la tomo \r <br/> \r <br/> \r <br/> acerca de:\r <br/> es una foto normal de un man sonriendo mostrando el cuello con un porro en la boca la sintensis habla de las buenas acciones que puede hacer un buen compañero o un buen amigo y es la antitesis de desgraciado steve "scumbag steve" \r <br/> \r <br/> \r <br/> <img src="http://es.memegenerator.net/cache/instances/400x/10/10303/10550525.jpg"> <img src="http://es.memegenerator.net/cache/instances/400x/10/10949/11212666.jpg"> <img src="http://es.memegenerator.net/cache/instances/400x/10/10966/11230115.jpg">\r <br/> \r <br/> para crear los memes de good guy greg con mas facilidad ve a la siguiente pagina:  <a href="http://es.memegenerator.net/Good-Guy-Greg"=_blank>generador de memes</a>  y no olvides subir tus ideas a memegusta y reitear las ideas de otros :D\r <br/> \r <br/> \r <br/> ', 9, '2012-01-12 03:14:52', 1, 'ES', '4af433b5d9eb59c7898f9bd2f70a88b2thumbnail.jpg', 'e6648e69d0225587927898223f381366.jpg', 0),
(1000004, 'SCUMBAG STEVE "desgraciado steve"', '<b>\r <br/>  <br/> DESGRACIADO STEVE \r <br/>  <br/> \r <br/>  <br/> ORIGEN: aparecio por primeravez en reddit en una foto de su primer album de rap titulado “Ma Gangsta” producido por Beantown Mafia el hombre de la foto  tiee de nombre Blake Boston y es el personaje que representa a scumbag steve en su foto de meme que fie extraida de su myspace luego de conocerse el cover de su album esta foto segun Blake Boston fue tomada por su madre en un desparche \r <br/>  <br/> \r <br/>  <br/> FOTO COVER DEL ALBUM \r <br/>  <br/> \r <br/>  <br/> <img src="http://i0.kym-cdn.com/photos/images/newsfeed/000/094/528/l_66e4d209ad558229ea23a69b45b8c8e1.gif">\r <br/>  <br/> \r <br/>  <br/> FOTO USADA COMO MEME \r <br/>  <br/> \r <br/>  <br/> <img src="http://i0.kym-cdn.com/photos/images/newsfeed/000/093/953/SCUMBAG%20STEVE.jpg?1318992465">\r <br/>  <br/> \r <br/>  <br/> ACERCA DE:\r <br/>  <br/> \r <br/>  <br/> scumbag steve desgraciado steve es una mala persona, influencia y demas  solo hace el mal en cosas de la vida cotidiana jamas piensa en los demas ni le importa la integridad de nadie mas que la sulla siempre se termina follando a tu novia hermana y demas no respeta la privacidad de nadie y te hace quedar mal para el quedar bien \r <br/>  <br/> \r <br/>  <br/> <img src="http://es.memegenerator.net/cache/instances/400x/12/12386/12683830.jpg">\r <br/>  <br/> \r <br/>  <br/> <img src="http://es.memegenerator.net/cache/instances/400x/12/12376/12673157.jpg">\r <br/>  <br/> \r <br/>  <br/> <img src=" http://es.memegenerator.net/cache/instances/400x/12/12672/12976139.jpg ">\r <br/>  <br/> \r <br/>  <br/> <img src="http://es.memegenerator.net/cache/instances/400x/11/12208/12501576.jpg">\r <br/>  <br/> \r <br/>  <br/> \r <br/>  <br/> para crear memes de scumbag steve dale click a este link : <a href="http://es.memegenerator.net/Scumbag-Steve"=_blank>generador de memes</a>\r <br/>  <br/> \r <br/>  <br/> y no te olvides de postear los memes que creaste en memegusta y de reatear los de los demas pasenla rico :D \r <br/>  <br/> ', 27, '2012-01-16 01:41:39', 1, 'ES', '63485b6563b9c4236d1d28660fce6135thumbnail.jpg', '9e49ee46ba4801c9365557ddee8edc40.jpg', 0),
(1000003, 'Joseph Ducreux', 'ORIJEN:\r <br/> El orijen de este meme salio de algunos blogs, un gripo de vagos tomo la imagen del auto retrato del conocido baron Joseph Ducreux y plasmo en el frases de rap de los  años 80 escritas e forma tradicional en ingles antiguo del siglo XIX, la razon por la que se usa la imagen de Decreux es por que para su epoca era un pintor poco convencional cullos autoretratos mostraban expresiones que para la epoca era un poco salidas de tono \r <br/> \r <br/> EJEMPLOS DE AUTORRETRATOS DE DUCREUX\r <br/> \r <br/> <img src="http://upload.wikimedia.org/wikipedia/commons/6/61/Joseph_Ducreux_-_Le_Discret.jpg">\r <br/> \r <br/> <img src="http://upload.wikimedia.org/wikipedia/commons/thumb/a/a1/Ducreux-1.jpg/421px-Ducreux-1.jpg">\r <br/> \r <br/> <img src="http://upload.wikimedia.org/wikipedia/commons/f/ff/Ducreuxyawn.jpg">\r <br/> \r <br/> en español este meme se conoce por frases que no salen del rap sino obiamente del regueton escritas en castellano antiguo la idea es que entre mas sugestiva sea la frase, mas compleja deva ser su traduccion\r <br/> \r <br/> EJEMPLOS \r <br/> \r <br/> 1: DANZA KUDURO - DON OMAR \r <br/> \r <br/> <img src="http://es.memegenerator.net/cache/instances/400x/11/11714/11995726.jpg">\r <br/> \r <br/> 2: DADY YANKEE -  GASOLINA  \r <br/> \r <br/> <img src="http://es.memegenerator.net/cache/instances/400x/11/11270/11541414.jpg">\r <br/> \r <br/> 3: Y POR ULTIMO /FIESTA FIESTA PLUMA PLUMA GAY (NIIDEA DE COMO SE LLAMA LA CANCION)\r <br/> \r <br/> <img src="http://es.memegenerator.net/cache/instances/400x/11/12054/12343859.jpg">\r <br/> \r <br/> \r <br/> ACERCA DE:\r <br/> Joseph, Barón de Ducreux (26 de junio de 1735 – 24 de julio de 1802) fue un pintor de retratos francés, pastelista, miniaturista, y grabador, que fue un retratista exitoso en la corte de Luis XVI de Francia, y fue capaz de ejercer su carrera después de la Revolución francesa. Sus retratos menos formales muestran un interés en expandir el rango de expresiones faciales más allá de las utilizadas en retratos oficiales.\r <br/> \r <br/> \r <br/> \r <br/> PARA CREAR ESTE TIPO DE MEME ENTRA EN EL SIGUIENTE LINK: \r <br/> <a href="http://es.memegenerator.net/Joseph-Ducreux"=_blank>generador de memes</a>\r <br/> \r <br/> NO OLVIDES CRERA TUS MEMES Y SUBIRLOS A MEMEGUSTA ADEMAS DE VOTAR POR LOS DE LOS DEMAS PARA QUE NUNCA ACABE A DIVERSION\r <br/> ', 27, '2012-01-13 17:08:38', 1, 'ES', 'c01ee31ca11ac4f9bf6f8f8d18d61be1thumbnail.jpg', 'bb953d293ef7cf6f9c39f5abf11ee6b1.jpg', 0),
(1000005, 'filopsiraptor', '<b>ACERCA DE: filopsiraptor es un meme que se basa en una imagen de un raptor que por cuestiones de posición parece estar filosofando es uno de los mas populares en el Internet actualmente y se basa en dos frases que juntas crean un silogismo o algún dilema filosófico. \r <br/> \r <br/> ORIGEN: la imagen de philopsiraptor nació de una compañía de camisetas que uso la imagen, con el nombre alrededor de octubre del 2008:\r <br/> \r <br/> <img src="http://i0.kym-cdn.com/photos/images/original/000/145/724/Philosoraptor_Light_Blue_large.jpg?1310089141">\r <br/> \r <br/> apesar de que la palabra filopsiraptor ha sido usada muchas veces en el internet de miles de maneras es imposible unir estos cabos hacia el nombre de este meme ya que las palabras filosofia y velociraptor son bastante sencillas de combinar y suele pasar muy segido sin razon aparente \r <br/> \r <br/> e aqui unos ejemplos del meme en cuestion entreellos los mas destacados \r <br/> \r <br/> \r <br/> <img height="300" src="http://b.images.memegenerator.net/instances/500x/9212905.jpg"><img height="300" src="http://b.images.memegenerator.net/instances/500x/11033737.jpg">\r <br/> \r <br/> <img height="300" src="http://a.images.memegenerator.net/instances/500x/11320584.jpg"><img height="300" src="http://a.images.memegenerator.net/instances/500x/9425528.jpg">\r <br/> \r <br/> Para crear tus propios memes de Filopsiraptor has click en este link  <a href="http://es.memegenerator.net/Joseph-Ducreux"=_blank>generador de memes</a> no olvides subir tus ideas a memegusta.com.co , comentar y calificar las ideas de los demas !\r <br/> ', 27, '2012-02-07 04:40:30', 1, 'ES', 'dfbb1f951eb33bc0438aa9f7bf49b17dthumbnail.jpg', 'c2ed5574257909b9992351188210abf7.jpg', 0);
