(151, 'De que universidad eres?', 'BUSCAN TRABAJO LOS NUEVOS PROFECIONALES RECIÉN EGRESADOS\r <br/> \r <br/>  DE ACUERDO A LA UNIVERSIDAD\r <br/> \r <br/> ********************************** \r <br/> \r <br/> UNIVERSIDAD NACIONAL\r <br/> \r <br/>  \r <br/> \r <br/> Yo nací en el seno de una familia pobre, soy\r <br/> \r <br/> desplazado de la guerrilla y sufrí penurias para\r <br/> \r <br/> terminar la carrera. Mi meta es ser el presidente(a)\r <br/> \r <br/> del sindicato de la compañía,  Por eso le suplico me contrate.\r <br/> \r <br/> Lo único que exijo de dotación para el uniforme varios pasamontañas.\r <br/> \r <br/> El sueldo es lo que indiquen las centrales obreras\r <br/> \r <br/>  \r <br/> \r <br/>   **************************************\r <br/> \r <br/> JAVERIANA\r <br/> \r <br/>  \r <br/> \r <br/> Papi me pagó la carrera, y gracias a Dios, terminé.\r <br/> \r <br/> Después de catorce semestres y medio.\r <br/> \r <br/> No estoy acostumbrado a madrugar y no me gusta llegar\r <br/> \r <br/> temprano al trabajo, pero con suerte y algo de dinero\r <br/> \r <br/> podemos arreglarnos para que yo esté en tu empresa\r <br/> \r <br/> mientras me caso con alguien que me mantenga o bien\r <br/> \r <br/> mientras mi papi me consigue algo mejor.\r <br/> \r <br/> O me consigo un tipo que me mantenga\r <br/> \r <br/> Por cierto, los viernes me será difícil llegar\r <br/> \r <br/> a la hora convenida, porque tú sabes que el weekend\r <br/> \r <br/> inicia desde el jueves,  y muchas veces sale\r <br/> \r <br/> algo de trabajo en la rumba o.k.?\r <br/> \r <br/> ****************************************\r <br/> \r <br/>  \r <br/> \r <br/> UNIVERSIDAD PEDAGÓGICA\r <br/> \r <br/>  \r <br/> \r <br/> Muy buenas, yo le puedo ayudar con mis servicios, y si quiere puede\r <br/> \r <br/> traer los niños de su casa para que no tenga que pagar niñera,\r <br/> \r <br/> pues además de mi profesión me enseñaron como educar,\r <br/> \r <br/> y por eso se educar, porque como me enseñaron a educar,\r <br/> \r <br/> pues se educar, pero tambien se hace otra cosa, pero siempre educando,\r <br/> \r <br/> pues es lo que me educaron, ya que es importante educar.\r <br/> \r <br/> Y si quiere, yo educo, y le enseño a educar, pues\r <br/> \r <br/> yo se educar y tal vez us ted necesite quien le enseñe a\r <br/> \r <br/> educar, porque educar es importantísimo, por eso yo fuí educado\r <br/> \r <br/> y quiero educar. Si al fin se da cuenta que sólo yo se educar, yo le ayudo a educar, pues\r <br/> \r <br/> es lo que se hacer, educar, como lo eduqué al presentarme y sugerirle\r <br/> \r <br/> en qué debe ser educado. Y no olvide darme trabajo, pues soy muy educado y se educar.\r <br/> \r <br/>  \r <br/> \r <br/>  ****************************************\r <br/> \r <br/> UNIVERSIDAD DE LOS ANDES\r <br/> \r <br/>  \r <br/> \r <br/> La extensión de mi currículo era tal, que he decidido\r <br/> \r <br/> enviárselo en CD ROM.\r <br/> \r <br/> Puede usted llamarme al celular o dejar mensaje con\r <br/> \r <br/> mi secretaria.\r <br/> \r <br/>  \r <br/> \r <br/> **************************************** \r <br/> \r <br/> UNIVERSIDAD DE LA SABANA\r <br/> \r <br/>  \r <br/> \r <br/> Creo que tienes una buena empresa pero aun le ace\r <br/> \r <br/> falta personal altamente capazitado como yo y creo que\r <br/> \r <br/> puedo sacarte de esta hoya (modestia aparte).\r <br/> \r <br/> Me gustaría que me dieras una rasón pronto ya que\r <br/> \r <br/> tengo en espera ofertas de empresas como Cokacola y\r <br/> \r <br/> MaCann Erigsson entre otras.\r <br/> \r <br/> Espero tomes en cuenta mi hoja de vida lla que es\r <br/> \r <br/> difisil encontrar personas con este perfil.\r <br/> \r <br/> Me toco mandarte esto por email ya que no me han\r <br/> \r <br/> entregado mi nuevo Haudi y como nunca he montado en bus\r <br/> \r <br/> y no se que es el trasmilenio no pude yevartela\r <br/> \r <br/> personalmente.\r <br/> \r <br/> Cuando quieras me yamas al celular, discutimos mi\r <br/> \r <br/> umilde salario al que azpiro y cuadramos un cotegito\r <br/> \r <br/> en chia que tengo un citiazo donde la paca es\r <br/> \r <br/> baraticima! ................ Claro que si no te gusta el tejo le\r <br/> \r <br/> decimos a James que nos haliste a Rosinante HOSEA!!!\r <br/> \r <br/> ************************************** \r <br/> \r <br/>  \r <br/> \r <br/> UNIVERSIDAD DISTRITAL FRANCISCO JOSE DE CALDAS\r <br/> \r <br/>  \r <br/> \r <br/> Si visita mi página web podrá ver mi dirección de\r <br/> \r <br/> correo y mi número de beeper. También me conecto al\r <br/> \r <br/> canal irc curriculum de 8 a 10, y he creado un foro de\r <br/> \r <br/> discusión desde el que podrá acceder a un viaje\r <br/> \r <br/> virtual en el que conocerá a mi novia, a mi perro y\r <br/> \r <br/> varios trucos de hackers. También podrás conocer las veces\r <br/> \r <br/> que me precente  en la nacional para que veas\r <br/> \r <br/> que por poquito y paso, además ver mi excelente pinta\r <br/> \r <br/> dominguera jeans negros, tenis rojos y mi saco de lana verde o amarillo  \r <br/> \r <br/>  \r <br/> \r <br/>  ****************************************\r <br/> \r <br/> UNIVERSIDAD EXTERNADO\r <br/> \r <br/>  \r <br/> \r <br/> Soy master MA, MS; MBA; NBA y del Universo. Me ha\r <br/> \r <br/> bastado un vistazo a su empresa para darme cuenta que\r <br/> \r <br/> tienen problemas. Yo podría ayudarle por una módica\r <br/> \r <br/> cantidad. Pero como usted no tiene ni idea, le cobraré\r <br/> \r <br/> el doble. por que en ninguna universidad del universo\r <br/> \r <br/> salimos tan preparados para ayudarle\r <br/> \r <br/> ***************************************\r <br/> \r <br/>  \r <br/> \r <br/> SEMINARIO MAYOR ARQUIDIOCESANO\r <br/> \r <br/> Por los mil demonios al fin salí de ese encierro donde la única acción era pura "paja", ahora quiero decirle que si no me contrata como su capellan, no va tener quien le ayude a mantener callados a todos esos pobres empleados mal pagos qu