(152, 'Perdon divino', 'Estaba el cura dando misa en la iglesia y les dice a sus feligreses: - Hijos míos, mañana viene el Papa a Colombia a perdonar a todos los que votaron por Serpa. ¡Sí hijos míos!, viene a perdonar a todos los que votaron por Serpa, porque los que votaron por Andrés no tienen perdón de Dios', 4, '2011-12-02 11:59:28', 0, 'Y', 'ES', 4, 'N', 0, 1, ''),
(153, 'Fidel...', 'La llamada telefónica.\r <br/> Fidel Castro, se muere y llega al infierno, allí se encuentran otros expresidentes llamando por teléfono a sus respectivos paises.\r <br/> Al encontrase con su amigo Gorbacho le pregunta.\r <br/> -¿Qué tal Rusia?\r <br/> -Va algo mejor pero la llamada me ha salido en 40000 Rublos, una fortuna.\r <br/> Fidel decide preguntar al Diablo:\r <br/> -Cuanto me vale llamar a Cuba?\r <br/> -25 pesetas, contesta el diablo.\r <br/> -Pero como es tan barato?, vuelve a preguntar Fidel.\r <br/> Contesta el Diablo:\r <br/> -Mi Comandante, es barata porque es local. ', 4, '2011-12-02 12:00:14', 0, 'Y', 'ES', 4, 'N', 0, 1, ''),
(154, 'Marx', 'Se muere Marx y se va al infierno. A los tres dias sube el demonio a ver a San Pedro.\r <br/> - Coño Botero, que mala cara traes!\r <br/> - No me hables, macho, que me han mandao a un tal Marx, y ya no hay quien haga nada en el infierno. El tio ha montao una revolucion, con manifestaciones, huelgas... para que te voy a contar.\r <br/> - Oye, pues mandamelo paca unas semanas, a ver si se calman las cosas ahi abajo.\r <br/> - Pedro, macho, me has salvao la vida. Esta tarde te lo mando.\r <br/> A las 3 semanas vuelve a subir Lucifer.\r <br/> - Que, como os va con el Marx ese que os mande?\r <br/> - Ah, perfecto, macho, el tio se ha integrado aqui como nadie. Ha hecho amigos con los angeles, con los santos...\r <br/> El demonio, sorprendido dice:\r <br/> - Pero... pero... y que dice Cristo a todo esto?\r <br/> - Uy! Cristo y Marx son intimos, como uña y carne, siempre juntos discutiendo problemas filosoficos...\r <br/> El demonio no da credito a lo que oye, y pregunta\r <br/> - Pero bueno, y Dios que dice a todo esto?\r <br/> - Dios...? Dios...? Pero si Dios no existe!!', 5, '2011-12-02 12:01:29', 0, 'Y', 'ES', 4, 'N', 0, 1, ''),
