(1532, 'Jajajaja', '&#8206;2 tipos se movían muy rápido dentro del Supermercado con sus carritos\r <br/> de compras y se chocan el uno al otro; y uno le dice al otro:\r <br/> \r <br/> - Disculpe, es que busco a mi mujer\r <br/> \r <br/> - Que coincidencia, yo busco tambien a mi mujer...y ya estoy\r <br/> desesperado.\r <br/> - Bueno, talvez lo pueda ayudar, como es su señora?\r <br/> - Es flaquita, alta, pelo liso largo, castaño claro, piel ligeramente\r <br/> bronceada, las tetas operadas y con pequitas, piernitas torneadas, un\r <br/> culito redondito grande y bien duro, cara bella espectacular y anda con un\r <br/> vestidito blanco cortito en el que se nota que no tiene ropa interior.\r <br/> \r <br/> - Y la suya?*\r <br/> \r <br/> - La mía? la mia que coma mierda!!... vamos a buscar a la suya!!!', 0, '2012-06-04 00:26:55', 0, 'Y', 'ES', 4, 'N', 0, 26, ''),
