(1574, 'Un ingeniero...', 'Un ingeniero muere y llega al cielo. Pedro revisa y le dice: "Tu eres un ingeniero, estás en el lugar equivocado."\r <br/> \r <br/> Así que es enviado al infierno, donde es bienvenido. Pronto, el ingeniero se siente algo incomodo con el lugar; empieza a diseñar y crear mejoras. Poco después tienen aire acondicionado, sanitarios y escaleras electrícas, por supuesto, se vuelve alguien muy popular.\r <br/> \r <br/> Un día dios hablando con Satan le dice: "¿Qué tal van las cosas?"\r <br/> \r <br/> -"Hey, todo muy bien. Tenemos aire acondicionado, elevadores, Internet, y quién sabe con que más saldra este ingeniero."\r <br/> \r <br/> "Qué! tienes un ingeniero? debe ser un error - El nunca debio haber ido ahí, enviamelo."\r <br/> \r <br/> "Nunca! me gusta tenerlo por aca y lo conservare!"\r <br/> \r <br/> Dios insiste, "Envialo o te demando"\r <br/> \r <br/> Satan se rie y le responde, "Ah si, y de donde vas a sacar un abogado?"', 1, '2012-06-06 01:25:00', 0, 'Y', 'ES', 4, 'N', 0, 26, ''),
